import React from "react";
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import "./style.scss";
import styled from "styled-components";
import font from "./font/georgia.ttf";
import "./font awesome/all.min.css";
import Baniere from "./components/Baniere";
import PopularPlace from "./components/PopularPlace";
import Actualités from "./components/Actualités";
import Header from "./components/Header"; // Assurez-vous d'importer votre Header

const Div = styled.div`
  color: #deeaee;
  font-family: font;

  @font-face {
    font-family: font;
    src: url("${font}");
  }
`;

function App() {
  return (
    <Router>
      <Div id="all">
        <Header />
        <Routes>
          <Route path="/Acceuil" element={<Baniere />} />
          <Route path="/Restaurant" element={<PopularPlace />} />
          <Route path="/actualite" element={<Actualités />} />
        </Routes>
      </Div>
    </Router>
  );
}

export default App;
